	public static String doPostForm(String url, String json) {
        HttpPost httpPost = new HttpPost(url);
        httpPost.setHeader("userName", "admin");
	    httpPost.setHeader("hydrocarbon-token", "b6664308b9b64534881c4387c51e653a");
	    httpPost.setHeader("tokenTime", "2020-08-30");
	    httpPost.setHeader("depth", "2");
        String resultString = "";
       
        HttpResponse response;
		try {

            MultipartEntityBuilder builder = MultipartEntityBuilder.create();
            builder.addTextBody("JSONENTITY",json, ContentType.TEXT_PLAIN.withCharset("UTF-8"));
            
            httpPost.setEntity(builder.build());

            // 发起请求 并返回请求的响应
            response = httpClient.execute(httpPost, HttpClientContext.create());
            resultString = EntityUtils.toString(response.getEntity(), "utf-8");

        } catch (IOException e) {
            e.printStackTrace();
        } catch (Exception e) {
            e.printStackTrace();
        } finally {
        	
        }
        return resultString;
    }
	
